import { useEffect, useState } from "react";
import Blogs from "./Blogs";

const Home = () => {
    const [persons , changeInfo] = useState([
        {name: 'qmars', gender: 'he', city: 'toronto', age: 18, nativeAmerican: false, id: 0},
        {name: 'amitis', gender: 'she', city: 'seattle', age: 18, nativeAmerican: false, id: 1},
        {name: 'joe', gender: 'he', city: 'chicago', age: 21, nativeAmerican: true, id: 2}
    ]);

    const [whoisit, changeName] = useState('pier')

    const deleter = (id) => {
        const thisPerson = persons.filter(person => person.id != id);
        changeInfo(thisPerson);
    }
    useEffect(() => {
        console.log('oh a thing is changed');
    }, [  ]);

    return ( 
        <div className="home">
            <h1>{whoisit}</h1>
            <button type="button" onClick={changeName('mark')}>Change Whoisit</button>
            <Blogs persons={persons} title="non Native Americans" deleter={deleter}/>           
        </div>
     );
}
 
export default Home;
